const Post = ({post}) =>{
    return (<article>

        <p>{post.text}</p>
        {post.image ? (
        <img
          src={`${process.env.REACT_APP_BACKEND}/uploads/${post.image}`}
          alt={post.text}
        />
      ) : null}

    </article>);
};

export default Post;
